PREFIX sphn: <https://www.biomedit.ch/rdf/sphn-schema/sphn/>
SELECT ?patient WHERE {
  ?patient sphn:hasBirthDate ?dob .
  BIND(year(NOW()) - year(?dob) AS ?age)
  FILTER(?age >= §Age§)
}

